import { Avatar, TextField, Typography } from '@mui/material';
import { Box } from '@mui/system';
import React, {UseState}from 'react';
import NavbarSeller from './navbarSeller';
const MyProfile = () => {
    return ( <>
     <NavbarSeller/>
     <Box sx={{
        positon:"absolute",
        top:"100px",
        width:"100%",
        height:"150px",
        backgroundColor:"gray"
     }}>
        <Typography variant="h4" sx={{
            position:"relative",
            color:"red",
            alignSelf:"center"
        }}> HARENA.com the leading Ecommerce Website !</Typography>
     </Box>
     <Avatar sx={{
            position:"absolute",
            left:"4%",
            width:"100px",
            top:"110px",
            height:"100px"
        }}></Avatar>
    <Box sx={{
        position:"absolute",
        top:"30%",
        left:"10%",
        width:"80%",
        backgroundColor:"pink",
        height:"60%"

    }}>
        <TextField label="Manager FirstName" ></TextField> 
        <TextField label="Manager LastName" ></TextField> 
        <br></br>
        <br></br>
        <TextField label="CompanyName" ></TextField> 
        <TextField label="Phone No"></TextField>
        <br></br>
        <br></br>
        <TextField label="Region"></TextField>
        <TextField label="PhoneNumber"></TextField>
        <br></br>
        <br></br>
        <TextField label="City"></TextField>
     
        <TextField label="Stream"></TextField>
    </Box>
    </> 
    );
}

export default MyProfile;
